@media (max-width: 639px) {
    .wrap-order-contains img[alt*="confirm"]  {
        display:none !important;
    }
}

.order-contains, .ordernoscroll, .OrderContainsstyles__Items-sc-p1lcpb-1 {
    overflow-y: visible !important;
    max-height: initial !important;
}

.upsell-content strong {
    font-family: "Neuzeit Grotesk - Bold"
}

.upsell-content p {
    margin-top: 0;
}
.with-ng-bold strong {
    font-family: "Neuzeit Grotesk - Bold"
}

.because-purchased-list ul {
    margin: 0;
    padding-inline: 28px;
    padding-block: 0;
}

.because-purchased-list li {
    margin-top: 25px;
    padding: 0;
}

.because-purchased-list li:first-child {
    margin-top: 0;
    padding: 0;
}

.slider-wrapper.axis-horizontal {
    background:  linear-gradient(180deg, #F2F4F8 0%, #E6E8F1 100%);;
    border-radius: 8px;
    margin-bottom: 28px

}

.control-dots {
    background: white;
    padding-top: 12px !important;
}

.special-deal {
   background-clip: text;
   background: -webkit-linear-gradient(55deg,#BC2E3E, #0F2CC7 );
   -webkit-background-clip: text;
   -webkit-text-fill-color: transparent;
   text-shadow: 0px 0px #00000000;
   mask-image: linear-gradient(55deg,#BC2E3E, #0F2CC7 );
   -webkit-mask-image: linear-gradient(55deg,#BC2E3E, #0F2CC7 );
}

.price {

    background-clip: text;
  background: -webkit-linear-gradient(55deg,#BC2E3E, #0F2CC7 );
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;

  text-shadow: 0px 0px #00000000;
   mask-image: -webkit-linear-gradient(55deg,#BC2E3E, #0F2CC7 );
   -webkit-mask-image: -webkit-linear-gradient(55deg,#BC2E3E, #0F2CC7 );
}


.price-dollars {
    display: block;
    grid-column: 1 / 2;
    grid-row: 1 / 3;
}

.price-cents {
    display: block;
    max-height: 30px;
    grid-column: 2 / 3;
    grid-row: 1 / 2;
}

.price-accent-word {
    display: block;
    margin-left: -2px;
    letter-spacing: 1px;
    text-transform: uppercase;
    grid-column: 2 / 3;
    grid-row: 2 / 3;
}

.redheart-list ul {
    list-style-position: outside;
    padding: 0;
}

.redheart-list ul>li {
    background-image: url(https://promo.thepetlabco.com/_central_image_folder/2022/red-heart.svg);
    background-position: left 5px;
    background-repeat: no-repeat;
    background-size: 15px;
    line-height: 140%;
    list-style-type: none;
    margin-bottom: 10px;
    padding-left:20px !important;
}
